import React from 'react';
import styled, {css} from 'styled-components'

const ItemDetaildiv = styled.div`
  width: 100px;
  height: 100px;
  background: blue;
  border-radius: 50%;
`

export default function ItemDetail() {
  return <ItemDetaildiv />;
}
